import './App.css';
import React from "react";

const API = "http://maps.googleapis.com/maps/api/place/nearbysearch/json?location=5.9788,116.0753&radius=1500&type=restaurant&keyword=breakfast&key=AIzaSyAsM-TE6HjRKxM8Tph0HmDmwyaWgRYSuaM"

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      restaurants: [],
    };
  }

  componentDidMount(){
    fetch(API)
    .then(response => {
        console.log(response);
        response.json()
    })
    .then(data => {
        console.log(data);
        this.setState({restaurants:data});
    })
    .catch(error => {
        console.log("Error", error);
    });
    // fetch("/restaurants")
    // .then(data => {
    //   this.setState({restaurants:data});
    // })
    // .catch(error => {
    //   console.log("Error", error);
    // });
  }
  render() { 
    const {restaurants} = this.state;
    console.log("i am here", restaurants);

    return ( 
      <div className="App">
      <h1>Makanbah</h1>
      <h2>{restaurants.length}</h2>

      <ul>
        {restaurants.map(item=>
          <li key={item.name}>
            Restaurant Name: {item.name}
          </li>
        )}
      </ul>
      </div>
    );
  }
}

export default App;

